def merge_sorted(n, m, n_list, m_list):
    i = 0
    j = 0
    final = []
    while i < n and j < m:
        if n_list[i] < m_list[j]:
            final.append(n_list[i])
            i += 1
        else:
            final.append(m_list[j])
            j += 1

        if i == n and j < m:
            final.extend(m_list[j:])
        if j == m and i < n:
            final.extend(n_list[i:])

    return final


